sys_variable_value.value:
(function execute(inputs, outputs) {
  var package = inputs.pre_process_package;

  // Tables 
  var contractMods = package.contract_modifications;
  var currentEnvironment = package.current_environment;
  var periodOfPerformance = package.period_of_performance;
  var selectedServiceOfferings = package.selected_service_offerings;
  var cc = package.contract_considerations

  // environment instances 
  var instanceFields = [
    'instance_name', 'classification_level', 'instance_location', 'csp_region', 
    'performance_tier', 'pricing_model', 'pricing_model_expiration', 
    'operating_system_licensing', 'number_of_vcpus', 'storage_type', 'storage_amount', 
    'storage_unit', 'memory_amount', 'memory_unit', 
    'data_egress_monthly_amount', 'data_egress_monthly_unit'
  ];

  outputs.instances;
  if (currentEnvironment.environment_instances){
  	outputs.instances = getListRecords(
      currentEnvironment.environment_instances.toString(), 
      instanceFields, 
      'x_g_dis_atat_environment_instance')
      .map(function(instance) { 
        // set classification level for instance
        var classification = new global.GlideQuery('x_g_dis_atat_classification_level')
          .get(instance.classification_level, ['classification', 'impact_level'])
          .orElse(null);

      	if (classification === null) {
          var errorMessage = 'An environment instance has no classification level and'
            errorMessage += ' one should be provided.'  
            errorMessage += ' Environment Instance Name: ' + instance.instance_name + '.'
            errorMessage += ' Sys ID: ' + instance.sys_id + '.'
          gs.error(errorMessage)
        }

        delete classification.sys_id;
        instance.classification_level = classification;

        return instance;
      })
      .map(removeSysId);

  } else {
    outputs.instances = [];
  }

  // mapping of package periods
  outputs.package_periods_by_id = mapPackagePeriods(
    periodOfPerformance.base_period, periodOfPerformance.option_periods
  );

  // array of option periods
  if (periodOfPerformance.option_periods) {
    outputs.package_option_periods = periodOfPerformance
      .option_periods.split(",")
      .map(function(periodId) { return outputs.package_periods_by_id[periodId] });
  } else {
    outputs.package_option_periods = [];
  }


  // selected services and classification level instances
  var selectedServiceFields = [
    'other_service_offering', 'service_offering', 'classification_instances'
  ];

  if (selectedServiceOfferings) {
	  outputs.selected_service_offerings = getListRecords(
        selectedServiceOfferings.toString(),
        selectedServiceFields,
        'x_g_dis_atat_selected_service_offering')
    	.map(removeSysId)
        .map(getNestedServiceInfo);
  }

  // award history 
  outputs.awards = [];
  if (package.contract_award) {
    outputs.awards.push({
          contract_award_type: package.contract_award.contract_award_type.toString(),
          effective_date: package.contract_award.effective_date.toString(),
          modification_order: package.contract_award.modification_order.toString()
      });
  }
  if (contractMods) { 
    getListRecords(contractMods.toString(),
      ['contract_award_type', 'modification_order', 'effective_date'],
      'x_g_dis_atat_award_history')
      .map(removeSysId)
      .forEach(function(mod) { outputs.awards.push(mod) });

  }

  var trainingRequired = convertToBoolean(cc.contractor_required_training.toString());
  if (trainingRequired) {
    var courses = JSON.parse(cc.required_training_courses.toString())
	var coursesOrder = Object.keys(courses).sort(function(a, b) { return a - b })
    outputs.training = [];
    // assuming it will start at 1 rather than zero
    for (var i = 1; i < coursesOrder.length + 1; i++) {
  		outputs.training.push(courses[i])
	}
  } else {
    outputs.training = [];
  }



  // stringifying outputs because the Array.Object() type 
  // for outputs is werid so this was a work around
  // to input them in the nex script
  outputs.awards = JSON.stringify(outputs.awards);
  outputs.instances = JSON.stringify(outputs.instances);
  outputs.package_option_periods = JSON.stringify(outputs.package_option_periods);
  outputs.selected_service_offerings = JSON.stringify(outputs.selected_service_offerings);
  outputs.training = JSON.stringify(outputs.training);

})(inputs, outputs);

